  "extractedText": "FARRO WITH BEET & MINT YOGURT\nBEET&MINT\nSERVES 4 TO 6 AS A SIDE DISH / Cooking farro slowly while constantly stirring helps pull the starches out\nof the grain and lends it a creamy texture without the need for copious amounts of butter or cream. The\naddition of roasted beet purée tints this dish a really cool deep-burgundy red and imparts a sweetness\nthat is offset by the sharp, herbaceous yogurt.\nMINT YOGURT\n2 Tbsp chopped fresh mint\n1 Tbsp chopped fresh flat-leaf parsley\n1/4 cup [60 ml] Greek-style yogurt\n1 lime\n1 tsp extra-virgin olive oil\nKosher salt\nFreshly ground black pepper\n2 red beets\nKosher salt\nFreshly ground black pepper\n1 Tbsp extra-virgin olive oil\n3 shallots, minced\n4 garlic cloves, minced\n1 cup [160 g] farro\n3 sprigs fresh thyme\n1 bay leaf\n1/2 cup [120 ml] dry white wine\n2 Tbsp Buttermilk Crème Fraîche (page 55)\nBest-quality olive oil for drizzling\nTo make the mint yogurt: In a mortar and pestle, crush the mint and parsley until it looks quite pulpy and\nwet. Gradually stir in the yogurt. Add a little water to make a loose sauce. With a Microplane, grate the zest\nfrom the lime directly into the yogurt. Squeeze 1 tsp of lime juice into the sauce. Stir in the olive oil, and\nseason with salt and pepper. (Store in an airtight container in the refrigerator for up to 2 days.)\nPreheat the oven to 425°F [220°C].\nPut the beets in a small ovenproof pan, and add about 1/4 in [6 mm] water. Cover tightly with aluminum foil\nor a lid, and roast until the beets can be easily pierced with the tip of a knife, 30 to 40 minutes. Remove\nfrom the oven and let cool in the pan. When cool enough to handle, slip the skins off the beets, and cut the\nbeets into quarters.\nIn a blender, process the beets with 2 cup [120 ml] water to make a smooth purée with the consistency of\ntomato sauce. (Add more water if necessary.) Season with salt and pepper.\nFill a teakettle with 2 qt [2 L] water and bring to a boil over high heat. Remove from the heat and set aside\nwhere it will stay warm.\nIn a large, heavy pot over medium heat, warm the extra-virgin olive oil until hot but not\nshallots and garlic and cook until trang\nsmoking. Add the\nthyme",
