[Process Text Job 800ba75d-3908-4808-abd0-a5890a44f94d] Final Parsed Result: {
  "extractedText": "Store in an airtight container in the refrigerator for up to 5 days. W\nMOJO DE AJO\nMAKES ABOUT 2 CUPS [480 ML] / This simple sauce of garlic caramelized in olive oil with lots of fresh citrus\ngoes well with a wide range of ingredients. We use it as a marinade and as a glaze to brush on vegetables,\nmeat, or fish as they cook.\n1/2 cup [120 ml] extra-virgin olive oil\n30 garlic cloves, peeled\n1/2 cup [120 ml] fresh lime juice\n1 tsp dried oregano\n1/2 tsp crushed red pepper flakes\nKosher salt\n1/2 cup [120 ml] fresh orange juice\nPreheat the oven to 350°F [180°C].\nIn a small cast-iron or other type of ovenproof pan, combine the olive oil and garlic, making sure that the\ngarlic is completely submerged. Place in the oven and cook until the garlic is very soft and golden brown,\nabout 45 minutes. Stir in the lime juice and orange juice and return to the oven until slightly thickened,\nabout 15 minutes longer. Remove from the oven and let cool slightly.\nWith a fork, smash the garlic to make a rough paste. Stir in the oregano and red pepper flakes. Taste and\nseason with salt. The sauce will not emulsify; it will be very oily, and must be stirred before use.\nStore in an airtight container in the refrigerator for up to 1 month. Bring to room temperature before using.\n54/ GJELINA",
  "title": "MOJO DE AJO",
