[Process Text Job 6f3e7dc0-6de1-4862-a571-054d7f2e7087] Final Parsed Result: {
  "extractedText": "CHERRY TOMATO CONFIT\nMAKES 4 CUPS [800 G] / This confit is somewhat luxurious and takes a bit of extra effort to produce, but the\nlittle pearls of tomato flesh are sweeter and more delicate than our regular Tomato Confit (page 60). We\nspoon these over grilled vegetables or fish. Try them in Grilled Summer Squash, Za'atar & Cherry Tomato\nConfit (page 181).\n2 pt [760 g] Sun Gold cherry tomatoes, stemmed\n2 cups [480 ml] extra-virgin olive oil, plus more as needed\n4 garlic cloves, smashed\n1/2 cup [15 g] basil leaves\n1 tsp kosher salt\n3 fresh thyme sprigs\nPreheat the oven to 350°F [180°C]. Bring a large pot of water to boil over high heat. Prepare an ice-water\nbath by filling a large bowl with ice water.\nUse a paring knife to score a small X in the bottom of each tomato. Plunge the tomatoes into the boiling\nwater for 20 seconds, and immediately transfer them to the ice-water bath. Work in batches, if necessary,\nuntil all the tomatoes have been blanched.\nWhen the cherry tomatoes are cool, remove them from the water. With your fingers, gently slip the tomatoes\nout of their skins and place them in a single layer in a baking dish. Pour the olive oil over the tomatoes and\nadd the garlic, basil, salt, and thyme. Cover tightly with aluminum foil and bake for 30 minutes, or until the\noil is hot but the tomatoes remain vibrant and whole. Let cool completely.\nStore in an airtight container in the refrigerator for up to 2 weeks, completely covered with olive oil to\nprevent air from reaching them.",
  "title": "CHERRY TOMATO CONFIT",
